INSERT INTO `tb_buku` VALUES ('2', 'Hujan', 'Gramedia Pustaka', 'Tere Liye', 'Novel ini mengisahkan percintaan dan perjuangan hidup seorang perempuan bernama Lail. Ketika Lail baru berusia 13 tahun, dirinya harus menjadi seorang anak yatim piatu. Di hari pertama ia sekolah, ada sebuah bencana gunung meletus dan gempa dahsyat sehingga menghancurkan kota di mana ia menetap, bahkan merenggut nyawa ibu serta ayah Lail.', null);
